function GameBlock(){
    return (
        <div className="game-block">
            <a href="#"><img src="https://opengameart.org/sites/default/files/rounded_eyes_dog_game_character_sprites_0.jpg" />
            <p>The Game block goes here</p></a>
        </div>
    )
}

export default GameBlock
